import styled from "styled-components";

export default function About() {
  return (
    <Container>
        <img src="/assets/chad.png" alt="Chad"></img>
        <div>
        <h1>Olá! Meu nome é Vinicius Pedroso dos Reis e tenho paixão pela área tecnológica, 
            tanto na minha vida pessoal
            quando na minha construção de carreira. Próximo de me formar em
            engenharia elétrica, busco estágio e experiência primariamente nas
            áreas de desenvolvimento de novas tecnologias, uso de ferramentas
            digitais e automação de processos.</h1>
        </div>
    </Container>
  );
}


const Container = styled.div`
    height: auto;
    width: 100%;
    display: flex;
    justify-content: space-around;
    align-items: center;
    padding-top: 15%;
    background-color: #080808;

    img {
        padding-left: 5%;
        height: 25%;
        width: 25%;
        border: none;
        border-radius: 100%;
    }

    h1{
        padding-left: 5%;
        padding-right: 5%;
        font-size: 28px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }
`
